import React from 'react';

class feedComp extends React.Component {
  render() {
    return (
      <div className='container'>
        <div className='c-card-deck'>

          <div className='custom-card'>
            <div className='c-card-image'>
              <img src='https://siliconangle.com/wp-content/blogs.dir/1/files/2018/12/wallstreet.jpg' />
          </div>
            <div className='c-card-text'>
            random text
            </div>
            <div className='c-card-details'>
            details
            </div>
          </div>

          <div className='custom-card'>
            <div className='c-card-image'>
              heey
          </div>
            <div className='c-card-text'>

            </div>
          </div>

        </div>

      </div>
    );
  }
}

export default feedComp;
